          font-size: 16px !important;
        }

        .ui.swdh10 {
          font-size: 14px !important;
          width: 100%;
        }

        .ui[class*="left icon"].swdh10.input > input {
          padding-left: 3.2em !important;
          padding-right: 1em !important;
          font-size: 14px;
          font-weight: 500;
          border: 0 !important;
        }

        .ui.search .prompt {
          border-radius: 0.3rem !important;
          width: 100%;
        }

        .header_right {
          margin-left: auto;
          float: right;
          padding-right: 15px;
        }

        .header_right ul li {
          display: inline-block;
          vertical-align: middle;
        }

        .option_links {
          padding: 10px 9px;
          font-size: 20px;
          color: #91699c;
          position: relative;
        }

        .option_links i {
          font-size: 18px;
        }

        .option_links .icon_wishlist {
          background: rgba(246, 151, 51, 0.2);
          color: #f69733;
          height: 35px;
          width: 35px;
          display: inline-block;
