          width: 16px;
          height: 16px;
          text-align: center;
          line-height: 1.5;
          border-radius: 100%;
        }

        .opts_account {
          font-weight: 500;
          color: #2b2f4c;
          float: right;
          padding: 5px 5px 5px 10px;
          background: #f9f9f9;
          border-radius: 10px;
          margin-left: 17px;
        }

        .opts_account img {
          width: 30px;
          border-radius: 50%;
          border: 1px solid #fff;
          box-shadow: 0px 2px 2px 0px rgba(0, 0, 0, 0.1);
          margin-left: 0;
        }

        .opts_account .user__name {
          margin-left: 10px;
          font-size: 13px;
        }

        .opts_account:hover {
          color: #f55d2c !important;
        }

        .icon__1 {
          font-size: 18px;
          margin-right: 10px;
        }

