          padding: 20px 17px 10px;
          font-size: 12px;
          font-weight: 500;
          color: #afafaf;
          text-align: left;
          margin-bottom: 0;
        }

        .user_img img {
          width: 30px;
          border-radius: 100%;
          margin-left: 17px;
          margin-right: 15px;
        }

        .menu.dropdown_account {
          margin-top: 10px !important;
          border-top: 1px solid #fff !important;
          border-radius: 3px !important;
        }

        .menu.dropdown_account_rl {
          min-width: 220px !important;
        }

